const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Contacts" element={<ContactsPage />} />
        <Route path="/ips" element={<TipsPage />} />
      </Routes>
    </Router>
  );
};

export default App;
